import styled from '@emotion/styled'

const background = styled.body`
    margin: 0;
    padding: 0;
    background: #E5E5E5;
`

const Body = styled.div`
    height: 100%;
    background: #E5E5E5;
` 

const Layout = () => (
    <Body>
        Hello
    </Body>
)

export default Layout;
